import logo from './logo.svg';
import './App.scss';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
        <a class="bit-widget-initializer" data-artist-name="Space Bacon" data-display-local-dates="false" data-display-past-dates="false" data-auto-style="false" data-text-color="#FFFFFF" data-link-color="#FFFFFF" data-background-color="rgba(0,0,0,0)" data-display-limit="10" data-display-start-time="false" data-link-text-color="#000000" data-display-lineup="false" data-display-play-my-city="false" data-separator-color="rgba(124,124,124,0.25)"></a>
    </div>
  );
}

export default App;
